import Foundation
import SceneKit


func expandMoves(_ moves: String) -> [Int] {
    moves.compactMap { moveStringMap.firstIndex(of: $0) }
}

func compressMoves(_ moves: [Int]) -> String {
	String(moves.map { moveStringMap[$0] })
}

let moveStringMap: [Character] = ["Q","W","E","R","T","Y","U","I","O","P","A","S","D","F","G","H","J","K","L","Z","X","C","V","B","N","M","q","w","e","r","t","y","u","i","o","p","a","s","d","f","g","h","j","k","l","z","x","c","v","b","n","m","1","2","3","4","5","6","7","8","9","0","_","-","."]

extension Board {
	static func getAutomorphism(for moves: [Int], a: Int = .random(in: 0..<192)) -> [Int] {
        moves.map { Board.automorphisms[a][$0] }
    }
	
	static func getAllAutomorphisms(for board: [UInt64]) -> [[UInt64]] {
		var all: [[UInt64]] = Array(repeating: [0,0], count: 192)
		
		for p in 0..<64 {
			if (board[0] >> p) & 1 == 1 {
				for a in 0..<192 {
					all[a][0] |= 1 << automorphisms[a][p]
				}
			}
			if (board[1] >> p) & 1 == 1 {
				for a in 0..<192 {
					all[a][1] |= 1 << automorphisms[a][p]
				}
			}
		}
		
		return all
	}
	
